script: |
  super -f text -I q1607.spq | sort > q1607.out

inputs:
  - name: q1607.spq
    data: |
      SELECT + COUNT ( col2 ) FROM tab1 (FORMAT parquet) cor0 WHERE col1 IS NOT NULL AND + col0 + + - 53 + + 65 * col2 NOT IN ( col1, + col2 + 40, col1 / col2 );
  - name: tab1

outputs:
  - name: q1607.out
    data: |
      3
